import React from "react";
import { useEffect, useState, useContext } from "react";
import { useHistory } from "react-router-dom";
import Layout from "../components/Layout";

const Workspace = () => {
  const history = useHistory();
  const userName = localStorage.getItem("user_name");

  return (
    <Layout>
      <div className="mx-auto mt-5 md:w-4/5 font-mono">
        <h1 className=" space-x-1.5 text-4xl font-bold text-primary-default">Workspace</h1>
        <ul className=" ">
       
          <li className="space-x-1.5 transform inline-flex transition duration-500 hover:scale-110">
            <img
              src={require("../assets/work.gif")}
              alt="home"
              className="hidden w-7/12 object-fit lg:block"
            />
          </li>
       
        </ul>
      </div>
    </Layout>
  );
};

export default Workspace;
